import { Email, LinkedIn, LocationOn, Mail, MailOutline, Phone } from "@material-ui/icons";
import "./resume.css";

function Resume() {
  return (
    <div
      className="bg-move-resume"
      // style={{
      //   backgroundImage: `url("assets/images/n1.jpg")`,
      // }}
    >
      <div className="mainTop">
        <div className="row resumeTopRow">
          <div className="col resumeTopCol" id="">
            <span className="nameText "> Mohd Nafees Software Developer</span><br/><br/>
            <p>
              I see myself as ambitious, self made and diligent person who
              believes in teamwork and has a good learning attitude with an
              aspiration to forge ahead of competition.
            </p>
          </div>


          <div className="col resumeBottomCol" id="">
            <p className=""> <MailOutline /> m.nafees786.mn17@ gmail.com</p>
            <p><Phone /> + 91 7490078839</p>
            <p><LinkedIn /> mohd-nafees-58172321b</p>
            <p><LocationOn /> Ahmedabad Gujarat, India - 380023</p>
          </div>

          <div className="col resumeMiddleCol" id="">
            <div className="imgDiv">
              <img src="assets/images/a1.webp" alt="" className="resumeImg" />
            </div>
          </div>

        </div>
      </div>

      <div className="row">
        <div className="col-6"></div>
        <div className="col-6"></div>
      </div>
    </div>
  );
}

export default Resume;
